import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CarForm from './components/CarForm';
import SecondTable from './components/SecondTable';
import ThirdTable from './components/ThirdTable';
import ListView from './components/ListView';  // Assuming ListView is your list page component
import './App.css';
import axios from 'axios';

axios.defaults.baseURL = "http://localhost:8081";

function App() {
  const [cars, setCars] = useState([]);
  const [pendingCars, setPendingCars] = useState([]);

  useEffect(() => {
    axios.get('/api/cars')
      .then(response => {
        setCars(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the cars!', error);
      });
  }, []);

  const handleAddCar = (car) => {
    setPendingCars([...pendingCars, car]);
  };

  const handleRegister = () => {
    axios.post("/api/cars", pendingCars, {
      headers: {
        "Content-Type": "application/json"
      }
    })
    .then((response) => {
      console.log(response.data);
      setPendingCars([]);  // Clear the pending cars after successful registration
      navigate('/list');  // Redirect to the list view after successful registration
    })
    .catch((error) => {
      console.error("Error during registration:", error);
      alert("Error: " + (error.message || error));
    });
  };

  return (
    <Router>
      <div className="App">
        <h1>Car Registration</h1>
        <CarForm onAddCar={handleAddCar} />

        {pendingCars?.length > 0 && (
          <SecondTable
            pendingCars={pendingCars}
            onDelete={handleDelete}
            onUpdate={handleUpdateCar}
          />
        )}

        {cars?.length > 0 && (
          <>
            <ThirdTable
              cars={cars}
              onDelete={handleDeleteCars}
              onUpdate={handleUpdateCars}
            />
            <button type='button' onClick={handleRegister}>
              Register
            </button>
          </>
        )}
      </div>

      <Routes>
        <Route path="/list" element={<ListView cars={cars} />} /> {/* List page where the cars are displayed */}
      </Routes>
    </Router>
  );
}

export default App;
